installer-gui-script.script:
function SystemMeetsOSRequirements()
{
	return systemOs1058OrHigher();
}

function systemOs1058OrHigher()
{
	var result = false;
	try {
		result = system.compareVersions(system.version.ProductVersion, '10.5.8') >= 0;
	} catch (e) {}

	if (!result)
	{
		my.result.type = 'Fatal';
		my.result.title = system.localizedString('require-min-os-title');
		my.result.message = system.localizedString('require-min-os-message');
	}
	return result;
}

function IsProcessorSupported()
{
	var result = false;
	try {
		/* 10 is Intel, 2 is PPC */
		result = system.gestalt('sysa') == '10';
	} catch (e) {}

	if (!result)
	{
		my.result.type = 'Fatal';
		my.result.title = system.localizedString('require-intel-title');
		my.result.message = system.localizedString('require-intel-message');
	}
	return result;
}

function TargetVolumeMountpointIsRoot()
{
	var result = false;
	try
	{
		result = my.target.mountpoint == "/";
	} catch (e) {}

	if (!result)
	{
		my.result.type = 'Fatal';
	}
	return result;
}

function getOfficePlist()
{
	var plist = "/Applications/Microsoft Office 2011/Office/MicrosoftComponentPlugin.framework/Resources/Info.plist";
	return plist;
}

function getOfficePlistDict()
{
	var plist = getOfficePlist();
	try {
		plist_dict = system.files.plistAtPath(plist);
	} catch (e) {
		my.result.type = 'Fatal';
		my.result.title = 'Error';
		my.result.message = 'Error reading ' + plist;
	}
	return plist_dict;
}

function getOfficePlistValue(key)
{
	var value;
	var plist_dict;
	try {
		plist_dict = getOfficePlistDict();
		value = plist_dict[key];
	} catch (e) {
		my.result.type = 'Fatal';
		my.result.title = 'Error';
		my.result.message = 'Error reading ' + value + ' from ' + plist_dict;
	}
	return value;
}

function getOfficeVersion()
{
	var version = getOfficePlistValue("CFBundleVersion");
	return version;
}

function getUpdaterLanguage()
{
	var UPDATER_LANGUAGE = "en";
	return UPDATER_LANGUAGE;
}

function isOfficeLanguageSupported()
{
	var updater_language = getUpdaterLanguage();
	var lproj = "/Applications/Microsoft Office 2011/Office/MicrosoftComponentPlugin.framework/Resources/" + updater_language + ".lproj/Localized.rsrc";
	var result = false;
	try {
		result = system.files.fileExistsAtPath(lproj);
	} catch (e) {}

	if (!result)
	{
		my.result.type = 'Fatal';
		my.result.title = system.localizedString('no-updatable-version-title');
		my.result.message = system.localizedString('no-updatable-version-message');
	}
	return result;
}

function isOfficeVersionSupported()
{
	var UPDATER_MIN_VERSION = "14.1.0";
	var UPDATER_MAX_VERSION = "14.3.9";
	var office_version = getOfficeVersion();
	var result = false;
	try {
		result = (office_version >= UPDATER_MIN_VERSION) && (office_version <= UPDATER_MAX_VERSION);
	} catch (e) {}

	if (!result)
	{
		my.result.type = 'Fatal';
		my.result.title = system.localizedString('no-updatable-version-title');
		my.result.message = system.localizedString('no-updatable-version-message');
	}
	return result;
}

function isOfficeInstalled()
{
	var mcp_plist = getOfficePlist();
	var result = false;
	try {
		result = system.files.fileExistsAtPath(mcp_plist);
	} catch (e) {}

	if (!result)
	{
		my.result.type = 'Fatal';
		my.result.title = system.localizedString('no-updatable-version-title');
		my.result.message = system.localizedString('no-updatable-version-message');
	}
	return result;
}

function VolumeCheck()
{
	return TargetVolumeMountpointIsRoot() && volumeOs1058OrHigher() && isOfficeInstalled() && isOfficeVersionSupported() && isOfficeLanguageSupported();
}

function volumeOs1058OrHigher()
{
	var result = false;
	try {
		result = system.compareVersions(my.target.systemVersion.ProductVersion, '10.5.8') >= 0;
	} catch (e) {}

	if (!result)
	{
		my.result.type = 'Fatal';
		my.result.title = system.localizedString('require-min-os-title');
		my.result.message = system.localizedString('require-min-os-message');
	}
	return result;
}

function InstallationCheck()
{
	return SystemMeetsOSRequirements() && IsProcessorSupported() && HasEnoughMemory();
}

function HasEnoughMemory()
{
	var result = false;
	try {
		/* 1073741824 bytes (1 GB) */
		/* Check for >= 512 MB */
		result = system.sysctl('hw.memsize') >= ((1024 * 1024 * 1024) / 2);
	} catch (e) {}

	if (!result) {
		my.result.type = 'Fatal';
		my.result.title = system.localizedString('require-min-memory-title');
		my.result.message = system.localizedString('require-min-memory-message');
	}
	return result;
}
